  <style>
    body {
        background: blue;
    }
    .card {
        background: white;
        width: 1920px;
        height: 1080px;

        margin: 40px auto;
        box-sizing: border-box;
        padding: 0px;
    }

    .speaker_picture {
        position: absolute;
        top: calc(1080px / 2 - 200px);
        left: calc(1920px / 2 - 200px);
    }

    .svg {
        width: 400px; height: 400px;
        transform: rotate(15deg)
    }

    .card {
        position: relative;
    }
    .img_speaker {
            width: 240px;
        height: 240px;
        margin: 75px;
        border-radius: 200px;
    }
    .card .img_speaker, .card .svg {
        position: absolute;
        left: 20px;
    }



    footer {
        color: #4482F0; /*#CABD4B;*/
        font-size: 11px;
        font-family: sans-serif;
        text-align: center;
        margin: 25px;

        position: absolute;
        bottom: 5px;
        left: 0;
        right: 0;
    }
    </style>
